import React, { useState, useEffect } from 'react'
import NewButton from './NewButton';



const FavShows = () => {

    const [favShows, setFavShows] = useState([])

    useEffect(() => {
        fetch("http://localhost:3001/shows")
        .then(res => res.json())
        .then(data => {
            console.log(data)
            setFavShows(data)
        })
    }, [])

    const showsList = favShows.map(s => <li>{s.title}</li>)
    return (
        <div>
            <h3>My Shows</h3>
            <hr/>
            {showsList}
            <br />
            <br />
            <NewButton />
        </div>
    )
}

export default FavShows;
